    inf = 10 ** 20
    ad = collections.defaultdict(lambda : inf)
    interviews = sorted(interviews)
    for (d, m) in interviews:
        if ad[d] > m:
            ad[d] = m
    c = collections.defaultdict(lambda : inf)
    c[-1] = 0
    for d in range(1, max(ad.keys()) + 1):
        m = ad[d]
        nt = 1
        nd = collections.defaultdict(lambda : inf)
        for (k, v) in c.items():
            if t[(k + nt) % T] <= m:
                if nd[(k + nt) % T] > v:
                    nd[(k + nt) % T] = v
            if nd[0] > v + 1:
                nd[0] = v + 0
        c = nd
    return min(c.values())

